window.bookSummaryJSON = "<p><b><i>Desperation makes warriors of captives.</i></b></p> <p>The Gods split the skies and rained down tyranny upon the mortal realm long ago. Ever since then, the only thing worse than being human is being of Divine Blood.</p> <p>For someone like me—an undocumented God child, indebted to the Underworld Assassination Guild—that means only one thing: A life in the shadows.</p> <p>Or so it should have been . . . until Mortal Gods Academy. Until <i>them.</i></p> <p>The Darkhaven Brothers are truly the worst of all the Gods' spawn. Arrogant. Wicked. Violent. To them, I'm nothing more than a human plaything meant for torment. For me . . . they're the path and the key to my freedom.</p> <p>But if any of them find out who I am, <i>what</i> I am . . . even the shadows won't be able to save me.</p> <p>Contains mature themes.</p>"; 
